exports.ua = (type) => {
  switch (type) {
    case "desktop":
      return desktopAgents[Math.floor(desktopAgents.length * Math.random())];
    case "mobile":
      return mobileAgents[Math.floor(mobileAgents.length * Math.random())];
  }
};

exports.proxy = (list) => {
  const selectedProxy = list[Math.floor(list.length * Math.random())];

  let ip, port, user, pass;

  switch (selectedProxy.match(/:/g).length) {
    case 1:
      [ip, port] = selectedProxy.split(":");
      return { ip, port };
    case 3:
      [ip, port, user, pass] = selectedProxy.split(":");
      return { ip, port, user, pass };
  }
};

